INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto1`, `extension1`, `foto2`, `extension2`, `foto3`, `extension3`, `expiracion`, `cantpostulantes`, `idpostulante`, `borrada`) VALUES
(1, 1, 2, 1, 'Busco acompañante de viaje', 'Soy camionero y busco una persona que me acompañe en mi viaje hasta Rawson porque sufro problemas de sueño. \r\nSaldríamos el primer fin de semana de octubre y retornaríamos el fin de semana siguiente. \r\n* Condición fundamental: debe cebar buenos mates', , 'image/png', '', '', '', '', '2019-06-24', 0, 0, 0);
INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto1`, `extension1`, `foto2`, `extension2`, `foto3`, `extension3`, `expiracion`, `cantpostulantes`, `idpostulante`, `borrada`) VALUES
(2, 2, 3, 2, 'Reencontrarme con Ramirez', 'Ramirez es un burrito que tenía de mascota en un campo en Tucumán. Quisiera reencontrarme con él pero no puedo moverme por un problema físico. \r\nMe gustaría que alguien lo traiga desde mi pueblo para poder saludarlo y luego volver a llevarlo.\r\n*la foto es del 2004, Ramirez puede haber cambiado un poco', , 'image/jpg', '', '', '', '', '2019-06-24', 0, 0, 0);
