(3, 2, 3, 1, 'Busco testigo falso', 'El año pasado tuve un accidente automovilístico en el que choqué el frente de una casa. El dueño de esa casa me quiere llevar a juicio y estoy buscando evitarlo.\r\nNecesito de un/a abuelito/a que testifique a mi favor diciendo que choqué el frente de la casa por esquivarlo/a.', , 'image/png', '', '', '', '', '2017-06-10', 0, 0, 0);
