(4, 1, 3, 1, 'Karl', 'Karl es mi perrito y necesita de alguien que lo cuide durante la primera quincena de enero que me voy de vacaciones.\nEs muy juguetón y muy buena compañía.', , 'image/jpg', '', '', '', '', '2019-06-24', 0, 0, 0);
