(5, 1, 1, 2, 'Restaurar obra de arte', 'La imagen de la izquierda es la original y la de la derecha mi intento por restaurarla. ¿Alguien me haría la gauchada de acomodarla para que se parezca más a la original? ', , 'image/jpg', '', '', '', '', '2019-06-24', 1, 0, 0);
